import React from "react";

function Header() {

    function seeOrders(){
        fetch("http://localhost:9292/orders")
            .then(r => r.json())
            .then(console.log)
    }

    return (
        <header>
            <h3>Catalog</h3>
            <h1>Kyler's Online Store</h1>
            <h3>Order History</h3>
        </header>
    )
}

export default Header
